define({"topics" : [{"title":"Preparing web browsers","shortdesc":"\n                     <p class=\"shortdesc\">TestArchitect supports automated testing of web     applications on <span class=\"ph\">Internet Explorer</span>, <span class=\"ph\">Google Chrome</span>,       <span class=\"ph\">Mozilla Firefox</span>, Safari, and Microsoft Edge. Before beginning testing,     you must configure the target browser to ensure that <span class=\"ph\">TestArchitect Automation Agent</span> (a browser extension),       <span class=\"ph filepath\">TAWebPlugin</span> (a plug-in), remote debugging mode, WebDriver, and\/or     GeckoDriver are installed and enabled.\n                     </p>\n                  ","id":"SR_Enabling_TA_Agent","href":"TA_Tutorials_Sample_App\/Topics\/SR_Enabling_TA_automation_agent_def.html","menu": {"hasChildren":false,},"tocID":"SR_Enabling_TA_Agent-d46e20188","next":"SR_Enabling_TA_Agent-d46e20188",},{"title":"Testing Scrum Board","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> provides sample test modules that   demonstrate automated testing of the Scrum Board web application.\n                     </p>\n                  ","id":"Enabling_TA_agent_IE_SB","href":"TA_Tutorials_Sample_App\/Topics\/SR_Scrum_Board_testing.html","menu": {"hasChildren":false,},"tocID":"Enabling_TA_agent_IE_SB-d46e20450","topics":[]}]});